(0, 'Tổng Hợp Gift Code :', 'Tổng Hợp Giftcode : \n\ntanthu\nthoivang\nngocrong\nsaophale\ncaubenung\nhuvang\nhematite\ncaitrang'),
(1, 'Hỗ trợ nhiệm vụ', '1) Hỗ trợ nhiệm vụ TDST:\r\nNgày thứ 2-3-4 trong tuần từ 5h\r\nđến hết 7h và từ 17h đến hết 19h,\r\nchỉ những cư dân đang làm nhiệm vụ này mới vào được map có boss này xuất hiện\r\n(Núi khỉ đen, hang khỉ đen, núi khỉ đỏ).\r\n\r\n2) Hỗ trợ nhiệm vụ Xên Bọ Hung:\r\nNgày thứ 2-3-4 trong tuần, từ 2 giờ\r\nsáng đến hết 4 giờ sáng và từ 2 giờ\r\nchiều đến hết 4 giờ chiều, chỉ\r\nnhững cư dân đang làm nhiệm vụ\r\nnày mới vào được map có boss\r\nxuất hiện.\r\n(Thị trấn Ginder, Võ đài xên bọ hung).'),
(2, 'Tân thủ cậu bé ngọc rồng', 'Chào mừng các tân thủ đã đến với\r\nCậu Bé Ngọc Rồng.\r\nFb:https://www.facebook.com/KhanhDTK.dzzz\r\n@Copyright KhanhDTK'),
(3, 'Cơ chế tinh chế trang bị', 'Các cư dân có thể qua Bà Hạt Mít, bấm vào chức năng tinh chế'),
(4, 'Khi tạo tài khoản vào game', 'Chào mừng bạn đến với Ngọc Rồng!\r\nMình là KhanhDTK sẽ đồng hành cùng bạn ở thế giới này.'),
(5, 'Tổng Hợp Gift Code :', 'Tổng Hợp Giftcode : \n\ntanthu\nthoivang\nngocrong\nsaophale\ncaubenung\nhuvang\nhematite\ncaitrang\nmanhhon');
